import React from 'react';
import Wrapper from '../assets/wrappers/BigCard';

const BigCard = () => {
  return (
    <Wrapper>
      <div className='bigcard_box'>
        <div></div>
        <div></div>
      </div>
    </Wrapper>
  );
};

export default BigCard;
